import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'
import './index.css'

export default class Login extends Component {
    render() {
        return (
            <div id="Loginwrp">
                <input className="int" type="text" placeholder="请输入学号"/>
                <input className="int" type="password" placeholder="请输入密码"/>
                <NavLink className="none" to="/Register">没有账号点击注册</NavLink>
                <div><input type="checkbox" />记住密码</div>
                <button>登录</button>
            </div>
        )
    }
}
